features.script:
let ball, paddle, frame, blocks

// Canvas Size 64*64
let PIXELS = 64;

// Each pixel has a Red, Green & Blue sequential pixel
let RGB_PIXEL_SIZE = 3;

// Block Grid
let BLOCK_ROWS = 5;
let BLOCK_COLS = 8;

class Color {
  constructor(r, g, b) {
    this.pixels = [r, g, b];
  }
}

// COLORS
let RED = new Color(255, 0, 0);
let GREEN = new Color(0, 255, 0);
let BLUE = new Color(128, 128, 255);
let WHITE = new Color(255, 255, 255);
let GRAY = new Color(128, 128, 128);


// Listeners
feature.on('keys', e => {
  if (e.keys.left) {
    paddle.moveLeft();
  } else if (e.keys.right) {
    paddle.moveRight();
  }
})

feature.on('start', e => {
  reset();
})

feature.on('frame', e => {
  frame += 1;
  update();
  draw();
})

// Update/Draw/Reset

function update() {
  ball.update();
}

function draw() {
  feature.screen.fill(GRAY);

  ball.draw();
  paddle.draw();
  for (j = 0; j < blocks.length; j ++) {
    blocks[j].draw();
  }
}

function reset() {
  frame = 0;

  // Ball
  let randomX = Math.round(Math.random() * PIXELS);
  ball = new Ball(new ColoredBlock(randomX, 32, 1, 1, GREEN));

  // Paddle
  paddle = new Paddle(new ColoredBlock(29, 60, 10, 1, BLUE));

  // Blocks
  blocks = []
  for (let row = 0; row < BLOCK_ROWS; row++) {
    for (let j = 0; j < BLOCK_COLS; j ++) {
      let xPos = Math.floor(feature.screenWidth / 8 * j + 2);
      let yPos = row * 4 + 2;
      blocks.push(new Square(xPos, yPos, 5, 3, RED));
    }
  }

  // Draw
  draw()
}

// Classes

class Ball {
  constructor(obj) {
    this.object = obj;

    this.xVel = Math.random() > 0.5 ? 1 : -1;
    this.yVel = 1;
  }

  update() {
    if (frame % 2 != 0) {
      return
    }

    // wall collision detection
    if ((this.object.x + this.xVel) >= PIXELS 
      || (this.object.x + this.xVel) < 0) {
      this.xVel *= -1;
    }
    if ((this.object.y + this.yVel) < 0) {
      this.yVel *= -1;
    }
    if ((this.object.y + this.yVel) >= PIXELS) {
      reset();
    }

    // paddle collision detection
    if ((this.object.y + this.yVel) == paddle.object.y) {
      let nextX = this.object.x + this.xVel;
      if (nextX >= paddle.object.x 
        && nextX <= paddle.object.x + paddle.object.width) {
        this.yVel *= -1;
      }
    }

    // block collision detection
    for (let i = 0; i < blocks.length; i++) {
      let block = blocks[i]
      let nextX = this.object.x + this.xVel
      let nextY = this.object.y + this.yVel

      if (nextX >= block.x 
        && nextX < block.x + block.width 
        && nextY >= block.y 
        && nextY < block.y + block.height) {
        if (this.object.x < block.x 
          || this.object.x > block.x + block.width - 1) {
          this.xVel *= -1;
        }
        if (this.object.y < block.y 
          || this.object.y > block.y + block.height - 1) {
          this.yVel *= -1;
        }

        blocks.splice(i, 1)
        break
      }
    }

    // update position

    this.object.x += this.xVel
    this.object.y += this.yVel
  }

  draw() {
    this.object.draw();
  }
}

class Paddle {
  constructor(obj) {
    this.object = obj;
  }

  draw() {
    this.object.draw();
  }

  moveLeft() {
    if (this.object.x > 0) {
      this.object.x -= 2;
      draw();
    }
  }

  moveRight() {
    if (this.object.x + this.object.width <= PIXELS) {
      this.object.x += 2;
      draw();
    }
  }
}

class Square {
  constructor(x, y, w, h) {
    this.x = x;
    this.y = y;
    this.width = w;
    this.height = h;
    this.objects = [
      // Left Line
      new ColoredBlock(x, y, 1, h, RED),
      // Right Line
      new ColoredBlock((x + w - 1), y, 1, h, RED),
      // Top Line
      new ColoredBlock(x, y, w, 1, RED),
      // Bottom Line
      new ColoredBlock(x, (y + h - 1), w, 1, RED)
    ];
  }

  draw() {
    this.objects.forEach((obj) => {
      obj.draw();
    })
  }
}

class ColoredBlock {
  constructor(x, y, w, h, c) {
    this.x = x;
    this.y = y;
    this.width = w;
    this.height = h;
    this.color = c;
  }

  draw() {
    let screen_width_in_rgb_pixels = feature.screenWidth * RGB_PIXEL_SIZE;
    for (let i = 0; i < this.width; i++) {
      for (let j = 0; j < this.height; j++) {
        for(let rgbOffset = 0; rgbOffset < this.color.pixels.length; rgbOffset++){
          let xPos = (this.x + i) * RGB_PIXEL_SIZE + rgbOffset;
          let yPos = (this.y + j) * screen_width_in_rgb_pixels;
          feature.screen[xPos + yPos] = this.color.pixels[rgbOffset];
        }
      }
    }
  }
}
